'use strict';
({params, imports}) => {
  const encounter = params.entity;
  const formElement = params.formElement;
  const _ = imports.lodash;

  let visibility = true;
  let value = null;
  let answersToSkip = [];
  let validationErrors = [];

  // Fetch observations
  function getObsValue(uuid) {
    const obs = encounter.findObservation(uuid);
    const val = _.isEmpty(obs) ? obs : obs.getReadableValue();
    return val ? Number(val) : 0;
  }

  const allValue = getObsValue("5a36475e-6e4c-4cb7-bb40-1f18e20b50b6"); // All
  const asValue  = getObsValue("4660204d-f115-45b4-a05b-34f794ac8afd"); // AS
